import React from "react";

class Inputs extends React.Component {
  render() {
    return (
      <fieldset>
        <legend>Dados Pessoais</legend>
          <label for="nome">Nome:
            <input 
              type="text" 
              name="nome" maxLength={4}  required placeholder="Digite..." autoComplete="off" 
            />
         </label>
         <label for="email">Email:
            <input type="email" name="email" maxLength={50} required placeholder="Digite..." autoComplete="off" />

         </label>
      </fieldset>
    )
  }
}

export default Inputs
